import { useEffect, useState } from "react";

function App(){
  const [dataState, setDataState] = useState({
    loaded: false,
    data: ''
  });

  function dataLoading(){
    fetch('#')
    .then(response => response.json())
    .then(jsondata=> setDataState({
      loaded: true,
      data: jsondata
    }))
    .catch(error=>setDataState({
      loaded: false,
      error
    }))
  }

  useEffect(()=>{
    dataLoading();

    setInterval(() => {
      dataLoading();
      console.log()
    }, 300);
  },[])

  return <>
    <p>{dataState.loaded?dataState.data:'Please wait...'}</p>
  </>
}

export default App;
